# Blink an LED

## 1. Overview
In this lesson you will learn how to use a breadbord, how to place
components on it and how to control an LED.

## 2. Components required
* Development board;
* 1 x LED;
* 1 x 150 Ω resistor;
* Breadboard 830p;
* 2 x male-to-male jumper wires;
* Micro USB – Type A USB Cable;

